import React from 'react'
import "./Footer.css"
export default function Footer() {
  return (
    <div id='footer'>
      <h2>All Rights Reserved</h2>
      <div>
        <button><img height="30px" src={process.env.PUBLIC_URL + "/svg/telegram.svg"} alt="None" /></button>
      </div>
    </div>
  )
}
